// import Home from './pages/home'
import Fetch from './pages/readdata'
import './App.css';

import MapView from './MapView';

const App = () => {
  const locationId = 'your-location-id';

  return (
    <div>
      <h1>Map View</h1>
      <MapView id={locationId} />
    </div>
  );
};

export default App;
